C.Aw=new O.cr("Friday Night Survival",null,'This game is a round-based, 2D-RPG with a top-down overworld map. It was developed during a group project at the "Technische Hochschule Nuremberg" (German university of applied science).\n\n#### If I had to describe it in one sentence:\n> Pok\xe9mon, but in a night club setting, with crude humor, multiple dialog options and interesting battle mechanics.\n\nThe battle system is unique because you essentially have to balance your health points with your honor level (= damage multiplier) to survive fights. \n#### Example moves:\n- Crush a beer bottle with your bare hands to boost honor at the expense of hp\n- Call your mum for emotional support to heal at the expense of honor\n- Land "honorable" punches to slowly build honor at the expense of time\n- Throw a beer bottle for high damage at the expense of honor\n- Sometimes your only option is to drink your opponent under the table in a minigame\n\nAfter each fight, you replace one of your moves with one you "learn" from your opponent. All in all, even though the playtime is relatively short, the 13 enemies, 40+ moves and multiple hilarious dialog options give this game great replay value. \n\nSadly, there\'s no way to directly translate the humor into English, but if you\'re German or know someone who is, we highly recommend you give it a shot. Since this game was developed in Unity, it runs in your browser, no account required. \n\n**=> Unless you get offended easily, you\'ll have a blast, so try it out!**',"game development, pixel art, game balance, team management","- Create pixel art for everything that's not an in-battle character\n- Set up lighting to create a realistic atmosphere\n- Write scripts to animate the overworld\n- **Game balance:** Balance the difficulty curve for 40+ moves across 14 unique characters\n\n#### About game balance:\n\nThis was difficult since gut feeling isn't accurate. To solve it, I wrote a C# program to rank all moves on a percentage scale based on their actual strength. This strength was calculated by a complicated formula for a few chosen reference points. The reference points were the weakest/strongest moves and a few \"alternative moves\"  that an accurate formula should rank as equal. The result is still not truly objective, but probably as close as you can get without using AI to figure out the game meta programmatically. \n\nIn retrospect, simulating battles to calculate expected win percentages for each character sounds interesting, so I might do that at one point.\n\n---\nAside from these technological aspects, I also managed our Trello and organized meetings.",null,null,null,"https://ciriousjoker.github.io/fridaynightsurvival/","fridaynightsurvival.png",15727356e5,C.yD,C.y7)
