C.AH=new O.cr("ShadyVault",null,"This app provides an encrypted filesystem for Chrome OS. \nAfter creating a vault and linking a real folder, a new device shows up next to the external drives. This vault only exists in-memory, so reading/writing works like any other folder, but behind the scenes it's accessing the encrypted content of the linked folder. \n\nSadly, Google deprecated chrome apps for chromebooks as well and I doubt that Android apps can properly fill the gap anytime soon.\n\nUntil then, enjoy!\n","encryption, file systems, animation",'- **Encryption**, specifically [AES-256 GCM](https://en.wikipedia.org/wiki/Galois/Counter_Mode)\n- **Animations**\n\n#### About animations:\nIt might be a surprise, given that the software is about encrypting data, but I really liked how the UI turned out and just had to include animations.\n\nI\'m particularly proud of the transition when clicking the "add vault" button.\n\n=> If I had to pick one project to submit to a design contest or something, this would be it ;)\n',null,null,null,"https://shadyvault.web.app/","shadyvault.png",15555384e5,C.z6,C.qL)
