C.AJ=new O.cr("Didactduell",null,"Didactduell is an app for medical students I developed for a startup called Didactylus. The goal was to make learning interesting and replace expensive flash cards. Students could not only learn with the app via training mode but also challenge each other, chat, and improve their ranking among other features.\n\nSadly, the startup ultimately failed before it launched, but the app is still available as a browser version. It probably still has a few bugs and only a few demo questions are available, but apart from that, this demo contains all the functionality planned for the launch.\nJust create a new account (email verification is turned off) and play around with it.\n\nThere's also an admin panel where the team could add questions, upload images, review them, and ultimately publish them. This admin panel is not part of the demo for obvious reasons ;)","App development using Aurelia, Cordova & Firebase.","This was a huge project, especially since I was the only developer working on it. Here are all the different frameworks and technologies I learned how to use during development. I used all of these for the first time during this project, so I can't say I did everything perfectly. However, I still think I did a pretty good job and I learned a lot for future projects, especially regarding code quality.\n\n#### Technologies used:\n- **Aurelia:** Alternative to Angular/React/Vue to build the interface in a modular way\n- **Typescript:** Basically javascript, but objectively much better\n- **Material Design Components for Web:** Successor to Material Design Lite\n- **Firebase:** Auth, Firestore, Firebase Cloud Messaging, Storage, Hosting\n- **Webpack:** Compile typescript & do the packaging\n- **Cordova:** Wrap the web app and provide native functionality via plugins\n- Writing custom plugins for mobile to add specific push notification functionality\n- Writing well organized, modular and maintainable code",null,"https://didactduell.web.app/",null,null,"didactduell.png",15356664e5,C.yv,C.yZ)
