C.Ax=new O.cr("Legacy Manager & Uploader","legacymanager","A mod manager for [Super Smash Bros. Brawl Legacy XP.](http://www.smashbroslegacy.com/)\n- [**Legacy Manager:**](https://github.com/CiriousJoker/legacymanager) To download & update the game\n- [**Legacy Uploader:**](https://github.com/CiriousJoker/legacyuploader) For the mod team to upload new releases\n\nSadly, the tool didn't catch on in the community and the game was taken down eventually (most likely by Nintendo, but that's just speculation).","google drive api, oauth, electron, nodejs","- **Google Drive Api:** Upload the game files to the cloud\n- **OAuth:** Authorize the upload for the correct account\n- **Electron:** Package the app for cross platform\n- **NodeJS:** Native file system access via javascript\n\nThe cross platform functionality was never implemented, but it would have been relatively straight forward with the technologies used.","https://github.com/CiriousJoker/legacymanager/releases/latest",null,null,null,"legacyxp.png",15021432e5,C.y5,C.yb)
